const locale = {
  global: {
    logo: 'Omni-Door',
    start: 'Start',
    docs: 'Docs',
    lang: '中文'
  },
  home: {
    pageTitle: 'Omni-Door',
    title: 'Omni-Door',
    subtitle:
      'Where do you want your project to go? Let any Omni-Door help you!',
    description:
      'Provide front-end projects from the initialization, development, construction, release and other one-stop services.It supports many common front-end projects such as single page application (SPA), server-side rendering application (SSR), component library, lodash like toolset, etc.',
    btn_start: 'Getting Started',
    btn_docs: 'Documentation',
    license: 'MIT',
    why: [
      {
        title:
          'Many kinds of wheels are up to you',
        subtitle:
          'A complete front-end project project can be built in one line of command',
        intro: `Integrating typescript;
          Seamless docking of eslint, prettier, stylelint, commitlint,
          It can also access unit-test
          `,
        route: {
          page: 'start',
          params: {
            lang: 'en'
          }
        }
      },
      {
        title: 'React-SPA',
        subtitle:
          'The SPA project based on react and react router',
        intro: `SPA(Single-Application-App)  is the most frequently used project mode by front-end developers,
          Whether it is the H5 suitable for mobile terminal or the PC project serving for the middle and back office, it can meet the requirements of short development cycle, low cost, and low cost
          Project structure is simple, front and back end separation and other requirements…
          `,
        route: {
          page: 'docs',
          params: {
            lang: 'en',
            article: 'spa-react'
          }
        }
      },
      {
        title: 'React-SSR',
        subtitle:
          '基于 React 和 NextJs 的 SSR 项目',
        intro: `基于 React + NextJs 的 SSR(Server-Side-Render) 服务端渲染应用解决了 SEO 和前后端分离的问题，
          同时相比于 SPA 应用，也能有效的降低白屏时间，
          无论是 PC 官网 还是 M 站，都是一个很好的选择…
          `,
        route: {
          page: 'docs',
          params: {
            lang: 'en',
            article: 'ssr-react'
          }
        }
      },
      {
        title: 'React-Component',
        subtitle: '基于 React 的组件库项目',
        intro: `一套属于自己团队或公司内部使用的组件库，几乎是每个公司前端团队的标配；
          借助社区开源的组件库 Demo-UI 框架，如 docz、storybook、styleguidist 等，
          让组件库的开发不再是遥不可及的技术难题…
          `,
        route: {
          page: 'docs',
          params: {
            lang: 'en',
            article: 'component-react'
          }
        }
      },
      {
        title: 'toolkit',
        subtitle: '类lodash、ramda工具库',
        intro:
          '纯逻辑组件？耦合了业务需求的功能模块？不想耦合任何 UI 框架 —— 工具库项目很可能是你需要的…',
        route: {
          page: 'docs',
          params: {
            lang: 'en',
            article: 'toolkit'
          }
        }
      }
    ],
    demo: []
  },
  docs: {
    pageTitle: 'Omni-Door - Docs'
  },
  start: {
    pageTitle: 'Omni-Door - Start'
  }
};

